import { useState } from "react";
import { Link } from "react-router-dom";

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-white shadow-md fixed w-full z-50">
      <div className="max-w-7xl mx-auto px-6 lg:px-12">
        <div className="flex justify-between items-center py-4">
          {/* Logo */}
          <Link to="/" className="flex items-center text-xl font-bold text-gray-900">
            <img src="https://tse2.mm.bing.net/th?id=OIP.P9WPxglozVLZsI2-dyXiTQHaDF&pid=Api&P=0&h=180" alt="Logo" className="h-8 w-8 mr-2" />
            ProTasks Solution
          </Link>

          {/* Desktop Menu */}
          <div className="hidden md:flex space-x-8">
            <Link to="/" className="text-gray-700 hover:text-blue-500 transition">Home</Link>
            <Link to="/services" className="text-gray-700 hover:text-blue-500 transition">Our Services</Link>
            <Link to="/about" className="text-gray-700 hover:text-blue-500 transition">About Us</Link>
            <Link to="/contact" className="text-gray-700 hover:text-blue-500 transition">Contact Us</Link>
          </div>

          {/* Mobile Menu Button */}
          <button 
            onClick={() => setIsOpen(!isOpen)} 
            className="md:hidden text-gray-700 focus:outline-none text-2xl"
          >
            {isOpen ? "✖" : "☰"}
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      {isOpen && (
        <div className="md:hidden bg-white border-t">
          <Link to="/" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">Home</Link>
          <Link to="/services" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">Our Services</Link>
          <Link to="/about" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">About Us</Link>
          <Link to="/contact" className="block px-6 py-3 text-gray-700 hover:bg-gray-100">Contact Us</Link>
        </div>
      )}
    </nav>
  );
};

export default Header;
